import React from 'react';
import './App.css';
import ItemList from './ItemList';

function App() {
  return (
    <div className='App'>
      <section className='App-section'>
        <h2>Ejercicio 3.4.1</h2>
        <ul>
          <ItemList />
        </ul>
      </section>
    </div>
  );
}

export default App;
